import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { ChevronDown, ChevronUp } from 'lucide-react';

const FAQ = () => {
  const [openIndex, setOpenIndex] = useState(null);

  const faqs = [
    {
      question: "How long does it take to see results?",
      answer: "Most clients see significant improvements within 30-60 days. Some achieve top rankings in as little as 2 weeks. We provide a 30-day results guarantee - if you don't see improvements, you can cancel anytime."
    },
    {
      question: "Do you work with businesses in my industry?",
      answer: "Yes! We work with all types of local businesses - from plumbers and electricians to dentists, lawyers, restaurants, and more. Our strategies work for any business that relies on local customers."
    },
    {
      question: "What's included in your packages?",
      answer: "Each package includes comprehensive local SEO services: Google Maps optimization, citation building, review management, monthly reporting, and ongoing support. We handle everything from setup to maintenance."
    },
    {
      question: "Is there a contract or setup fee?",
      answer: "No contracts and no setup fees. You can cancel anytime with no penalties. We're confident in our results, which is why we don't lock you into long-term commitments."
    },
    {
      question: "How do you track results?",
      answer: "We provide monthly reports showing your Google Maps rankings, website traffic, lead generation, and other key metrics. You'll see exactly how your investment is performing."
    },
    {
      question: "What makes you different from other SEO companies?",
      answer: "We specialize exclusively in local SEO and Google Maps domination. While other agencies do everything, we focus on one thing and do it exceptionally well. Plus, our no-contract approach puts you in control."
    }
  ];

  const toggleFAQ = (index) => {
    setOpenIndex(openIndex === index ? null : index);
  };

  return (
    <section id="faq" className="relative py-20 bg-gradient-to-b from-[#0f0f1a] to-[#09090f] overflow-hidden">
      {/* Space background effects */}
      <div className="absolute inset-0">
        <div className="absolute top-20 left-1/4 w-1 h-1 bg-[#3abef9]/40 rounded-full blur-[1px]" />
        <div className="absolute top-40 right-1/3 w-0.5 h-0.5 bg-white/30 rounded-full blur-[0.8px]" />
        <div className="absolute bottom-40 left-1/3 w-1.5 h-1.5 bg-[#00ffff]/50 rounded-full blur-[1.2px]" />
        <div className="absolute bottom-20 right-1/4 w-0.8 h-0.8 bg-[#3abef9]/35 rounded-full blur-[1px]" />
      </div>

      <div className="container mx-auto px-4 relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-white mb-6 bg-gradient-to-r from-[#3abef9] to-[#007bff] bg-clip-text text-transparent">
            Frequently Asked Questions
          </h2>
          <p className="text-xl text-[#9ca3af] max-w-3xl mx-auto">
            Everything you need to know about our local SEO services and how we help businesses dominate Google Maps.
          </p>
        </motion.div>

        <div className="max-w-4xl mx-auto">
          {faqs.map((faq, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              className="mb-4"
            >
              <div
                className="bg-gradient-to-br from-[#10111a] to-[#0a0a0f] rounded-2xl border border-[#3abef9]/20 hover:border-[#3abef9]/40 transition-all duration-300 cursor-pointer"
                onClick={() => toggleFAQ(index)}
              >
                <div className="p-6 flex items-center justify-between">
                  <h3 className="text-lg font-semibold text-white pr-4">
                    {faq.question}
                  </h3>
                  <div className="text-[#3abef9] flex-shrink-0">
                    {openIndex === index ? (
                      <ChevronUp className="w-5 h-5" />
                    ) : (
                      <ChevronDown className="w-5 h-5" />
                    )}
                  </div>
                </div>

                <AnimatePresence>
                  {openIndex === index && (
                    <motion.div
                      initial={{ height: 0, opacity: 0 }}
                      animate={{ height: "auto", opacity: 1 }}
                      exit={{ height: 0, opacity: 0 }}
                      transition={{ duration: 0.3, ease: "easeInOut" }}
                      className="overflow-hidden"
                    >
                      <div className="px-6 pb-6">
                        <p className="text-[#9ca3af] leading-relaxed">
                          {faq.answer}
                        </p>
                      </div>
                    </motion.div>
                  )}
                </AnimatePresence>
              </div>
            </motion.div>
          ))}
        </div>

        {/* CTA Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6, delay: 0.4 }}
          className="mt-16 text-center"
        >
          <div className="bg-gradient-to-r from-[#3abef9]/10 to-[#007bff]/10 p-8 rounded-2xl border border-[#3abef9]/30">
            <h3 className="text-2xl font-bold text-white mb-4">
              Still Have Questions?
            </h3>
            <p className="text-[#9ca3af] mb-6 max-w-2xl mx-auto">
              We're here to help! Schedule a free strategy call and we'll answer all your questions about dominating your local market.
            </p>
            <button className="px-8 py-4 bg-gradient-to-r from-[#3abef9] to-[#007bff] text-white font-semibold rounded-xl transition-all duration-300 hover:shadow-[0_0_32px_0_rgba(58,190,249,0.4)] hover:scale-105">
              Get Free Strategy Call
            </button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default FAQ;
